import React from 'react';
import { StyleSheet, Pressable } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import Icon from 'react-native-vector-icons/FontAwesome';

import Index from './composants/views/Index';


const Stack = createNativeStackNavigator();

function App() {
  return (
       <NavigationContainer>
          <Stack.Navigator style={styles.titre_menu}>
              <Icon name="bars" size={27} color="#FF8038" />
              <Stack.Screen style={styles.nom_proj} name="e-Reserva" component={Index} />
              <Icon name="ellipsis-v" size={27} color="#FF8038" />
          </Stack.Navigator>
       </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  titre_menu: {
    backgroundColor: '#0E4452',
    flexDirection: 'row',
    justifyContent: 'space-between',
    paddingHorizontal: 20,
    paddingVertical: 10
  },
  nom_proj: {
    color: "white", 
    fontSize: 22, 
    marginRight: 40,
    fontWeight: 'bold'
  }
})

export default App;
